def format_job_to_text(job):
    text = f"Job Title: {job['title']}\n"
    text += f"Department: {job['department']}\n"
    text += f"Location: {job['location']}\n"
    text += f"Work Mode: {job['work_mode']}\n"
    text += f"Work Type: {job['work_type']}\n"
    text += f"Experience Required: {job['experience']}\n"
    text += "Description:\n" + "\n".join(f"- {item}" for item in job["description"]) + "\n"
    text += "Requirements:\n" + "\n".join(f"- {item}" for item in job["requirements"]) + "\n"
    return text

