## Comparison chain ##
def compare_jobs(job1_title, job2_title):
    job1_docs = vector_store.similarity_search(job1_title, k=1)
    job2_docs = vector_store.similarity_search(job2_title, k=1)

    if not job1_docs or not job2_docs:
        return "One or both jobs not found in our database."

    job1_info = job1_docs[0].page_content
    job2_info = job2_docs[0].page_content

    comparison_chain = (
        {"job1_info": RunnablePassthrough(), "job2_info": RunnablePassthrough()}
        | comparison_prompt
        | llm
        | StrOutputParser()
    )

    return comparison_chain.invoke({"job1_info": job1_info, "job2_info": job2_info})

"""## 5.8 RAG Fallback"""

def rag_fallback(query):
    try:
        intent = detect_intent(query)
        q = query.lower().strip()
        if "compare" in q or "difference between" in q:
            parts = q.replace("compare", "").replace("difference between", "").split(" and ")
            if len(parts) == 2:
                job1 = parts[0].strip()
                job2 = parts[1].strip()
                return compare_jobs(job1, job2)
            else:
                return "❌ Please mention exactly two job titles to compare, like 'Compare UX Designer and QA Specialist'."

        if intent in INTENT_RESPONSES:
            return INTENT_RESPONSES[intent]

        if "career path" in q or "growth" in q or "next step" in q:
            return career_path_chain.invoke(query)

        return basic_info_chain.invoke(query)

    except Exception as e:
        return f"❌ I couldn't process your request. Error: {str(e)}"

"""## 6. Conversation Engine"""

def handle_user_input(user_input):
    if not user_input.strip():
        return "👋 Welcome to EVA CareerMate assistant! Ask me anything about available job roles, required skills, locations, or even if you qualify."

    doc = nlp(user_input)
    intent = detect_intent(user_input)
    entities = {ent.label_: ent.text for ent in doc.ents}

    print("🤖 Intent Detected:", intent)
    print("🔍 Entities Found:", entities)

    for ent in doc.ents:
        print(f"{ent.text} → {ent.label_}")

    potential_job_titles = extract_job_title_from_text(user_input)
    job_title_to_check = entities.get("JOB_TITLE") or (potential_job_titles[0] if potential_job_titles else None)

    matched_check = get_best_job_title_match(job_title_to_check, job_data) if job_title_to_check else None
    if matched_check:
        conversation_context["last_job_title"] = matched_check
        if matched_check not in conversation_context["last_two_jobs"]:
            conversation_context["last_two_jobs"].insert(0, matched_check)
            conversation_context["last_two_jobs"] = conversation_context["last_two_jobs"][:2]

    if any(key in entities for key in ["LOCATION", "GPE", "LOC"]):
      conversation_context["last_location"] = (
        entities.get("LOCATION") or
        entities.get("GPE") or
        entities.get("LOC")
      )


    if intent == "get_job_requirements":
        job_title = job_title_to_check or conversation_context.get("last_job_title")

        if any(phrase in user_input.lower() for phrase in reference_phrases) and conversation_context.get("last_job_title"):
          job_title = conversation_context["last_job_title"]
        if not job_title:
            return "❌ Please mention the job title you're interested in."

        matched_title = get_best_job_title_match(job_title, job_data)
        if matched_title:
            conversation_context["last_job_title"] = matched_title
            job = next(job for job in job_data if job["title"] == matched_title)
            return f"""📌 Here's what you need to know about **{job['title']}**:
✅ **Required Skills & Qualifications:**
""" + "\n".join(f"- {r}" for r in job["requirements"]) + "\n\n📝 Would you like to see the experience needed or explore similar jobs?"
        else:
            suggestions = process.extract(job_title, [job["title"] for job in job_data], limit=3, scorer=fuzz.partial_ratio)
            suggestion_text = "\n".join([f"- {title}" for title, score in suggestions if score > 50])
            return f"❌ Couldn't find exact match for '{job_title}'.\n\nDid you mean:\n{suggestion_text}"

    elif intent == "get_experience_needed":
        job_title = job_title_to_check or conversation_context.get("last_job_title")
        if any(phrase in user_input.lower() for phrase in reference_phrases) and conversation_context.get("last_job_title"):
            job_title = conversation_context["last_job_title"]

        if not job_title:
            return "❌ Please mention the job title you're interested in."

        matched_title = get_best_job_title_match(job_title, job_data)
        if matched_title:
            conversation_context["last_job_title"] = matched_title
            job = next(job for job in job_data if job["title"] == matched_title)
            return f"""🧠 For **{job['title']}**, you'll need:
📅 {job['experience']} of relevant experience.
---

💬 **Want to know about required skills or compare this role with another?** """
        return f"❌ I couldn't find a job titled '{job_title}'. Please check the spelling or try a partial match."

    elif intent == "check_experience_sufficiency":
        years_match = re.search(r"(\d+)\s+year", user_input.lower())
        if not years_match:
            return "❌ Please mention how many years of experience you have."

        user_years = int(years_match.group(1))
        job_title = job_title_to_check or conversation_context.get("last_job_title")
        if "this job" in user_input.lower() and conversation_context.get("last_job_title"):
            job_title = conversation_context["last_job_title"]

        if not job_title:
            return "❌ Please mention the job title you're asking about."

        matched_title = get_best_job_title_match(job_title, job_data)
        if matched_title:
            job = next(job for job in job_data if job["title"] == matched_title)
            min_required_match = re.search(r"(\d+)", job["experience"])
            if min_required_match:
                min_required = int(min_required_match.group())
                return f"✅ Yes, {user_years} years is enough for {job['title']}." if user_years >= min_required else f"❌ No, {job['title']} requires at least {min_required} years."
        return "❌ Job not found."

    elif intent == "compare_jobs":
      return rag_fallback(user_input)


    elif intent == "get_department_location":
        job_title = job_title_to_check or conversation_context.get("last_job_title")
        if not job_title:
            return "❌ Please mention which job you mean."

        matched_title = get_best_job_title_match(job_title, job_data)
        if matched_title:
            job = next(job for job in job_data if job["title"] == matched_title)
            return f"""🏢 **{job['title']}**
Department: {job['department']}
📍 Location: {job['location']}"""
        return "❌ Job not found."

    elif intent == "search_by_location":
        user_city = (entities.get("LOCATION") or entities.get("GPE") or conversation_context.get("last_location") or entities.get("LOC"))

        if not user_city:
            location_patterns = [r"jobs?\s+in\s+([A-Za-z\s]+)", r"openings?\s+in\s+([A-Za-z\s]+)", r"positions?\s+in\s+([A-Za-z\s]+)", r"work\s+in\s+([A-Za-z\s]+)"]
            for pattern in location_patterns:
                match = re.search(pattern, user_input, re.IGNORECASE)
                if match:
                    user_city = match.group(1).strip()
                    break

        if not user_city:
            return "❌ Please tell me which city you're interested in."

        user_city = user_city.lower()
        matched_group = next((group for group, aliases in location_aliases.items() if any(alias in user_city for alias in aliases)), None)

        if matched_group:
            aliases = location_aliases[matched_group]
            matching_jobs = [job for job in job_data if any(alias in job["location"].lower() for alias in aliases)]
            if matching_jobs:
                return f"""📍 Jobs in **{matched_group.title()}**:\n""" + "\n".join(f"🔹 {job['title']} – {job['location']}" for job in matching_jobs)
            return f"❌ No openings currently in **{user_city.title()}**."
        else:
            direct_matches = [job for job in job_data if user_city in job["location"].lower()]
            if direct_matches:
                return f"""📍 Jobs in **{user_city.title()}**:\n""" + "\n".join(f"🔹 {job['title']} – {job['location']}" for job in direct_matches)
            return f"❌ We currently have no openings in **{user_city.title()}**."

    elif intent == "yes_no_question":
        text = user_input.lower()
        if "fresh" in text:
            fresh_jobs = [job for job in job_data if re.search(r"0-1|0", job["experience"])]
            return "✅ Yes, available fresh graduate openings:\n" + "\n".join(f"🔹 {job['title']}" for job in fresh_jobs) if fresh_jobs else "❌ No fresh graduate openings found."
        elif "remote" in text or "hybrid" in text:
            remote_jobs = [job for job in job_data if "remote" in job.get("work_mode", "").lower() or "hybrid" in job.get("work_mode", "").lower()]
            return "✅ Yes, remote/hybrid jobs:\n" + "\n".join(f"🔹 {job['title']} – {job.get('work_mode', 'N/A')}" for job in remote_jobs) if remote_jobs else "❌ No remote/hybrid jobs found."
        return "🤔 Please clarify your yes/no question."


    elif intent == "job_description":
      job_title = job_title_to_check or conversation_context.get("last_job_title")

      if any(phrase in user_input.lower() for phrase in reference_phrases) and conversation_context.get("last_job_title"):
          job_title = conversation_context["last_job_title"]

      if not job_title:
          return "❌ Please specify which job you want a description for."

      matched_title = get_best_job_title_match(job_title, job_data)
      if matched_title:
          conversation_context["last_job_title"] = matched_title
          job = next(job for job in job_data if job["title"] == matched_title)
          return f"🔍 **{job['title']} - Job Description:**\n{format_job_description(job.get('description', 'No description available.'))}"

      return f"❌ Couldn't find a job titled '{job_title}'. Please check the spelling or try again."
    else:
        return rag_fallback(user_input)

"""## 7. Audio Feature"""

## Voice Processing Functions ##
asr_model = whisper.load_model("base")

def remove_emojis(text):
    return re.sub(r'[\U00010000-\U0010ffff]', '', text)

def speech_to_text(audio_path):
    result = asr_model.transcribe(audio_path)
    return result["text"]

def text_to_speech(text):
    clean_text = remove_emojis(text)
    tts = gTTS(clean_text)
    temp_path = tempfile.mktemp(suffix=".mp3")
    tts.save(temp_path)
    with open(temp_path, "rb") as f:
        audio_base64 = base64.b64encode(f.read()).decode("utf-8")
    audio_data_uri = f"data:audio/mp3;base64,{audio_base64}"

    return audio_data_uri

def generate_voice_response(text):
    try:
        return text_to_speech(text)
    except Exception as e:
        print(f"TTS Error: {e}")
        return None

